import UserHome from '../pages/UserHome'

import { useLocation } from 'react-router-dom'

export default function MyRoutes(){



    return (

            <Routes>



            {localStorage.getItem("token_token") ?
            (
                <Route
                element={
                    <UserHome />
                }
                path='/'
                />
            ) :
            <Route
            element={
                <Home />
            }
            path='/'
            />
            }

